import React from "react";

function a(sent)
{
	return (
	<form>
		<div>
			<input type="checkbox" /><br />
			<label>Service #1</label><br />
			<input type="submit" onClick={sent = false} /><br />
		</div>
	</form>);
}

function b() {
	return <>hello world</>;
}

class App extends React.Component {
	constructor() {
		super();
		this.sent = true;
	}
	render() {
		return (sent ? a(sent) : b());
	}
}

export default App;
